import React from 'react';


const ProductsTable = (props) => {
  const data = [];
  props.produtos.forEach(product => {
    let newData = {key: null, produto: null, preco: null}
    product.custom_data.forEach(custom => {
      if (custom.key === 'product_name') newData.produto = custom.value
      else if (custom.key === 'transaction_id') newData.key = custom.value
      else if (custom.key === 'product_price') newData.preco = custom.value
    })
    data.push(newData)
  })
  return (
      <div>
        <table style={{borderCollapse: 'collapse', width: '100%', marginTop: '30px', backgroundColor: '#ddd'}}>
          <tr style={{borderTop: '1px solid #ddd', borderBottom: '1px solid #ddd'}}>
            <th>Firstname</th>
            <th>Savings</th>
          </tr>
          <tr>
            <td>Peter</td>
            <td>$100</td>
          </tr>
          <tr>
            <td>Lois</td>
            <td>$150</td>
          </tr>
          <tr>
            <td>Joe</td>
            <td>$300</td>
          </tr>
          <tr>
            <td>Cleveland</td>
            <td>$250</td>
          </tr>
        </table>
      </div>
  );
};

export default ProductsTable;
